import React from 'react';
import './index.css';
import PeopleContextProvider from './contexts/PeopleContextProvider';
import Display from './components/Display';

const App = () => {
  return (
    <div className="app">
      <PeopleContextProvider>
        <Display/>
      </PeopleContextProvider>
      </div>
  );
}

export default App;
